import { Link, Navigate, useNavigate } from "react-router-dom"

const Intermediate = () => {
    document.body.style.background = '#292C2E'

    let navigate = useNavigate()
    return (
        <div>
            <button onClick={() => { navigate("/current/hughes/2/leaderboard") }}>
                Hughes Period 2
            </button>
            <button onClick={() => { navigate("/current/hughes/2/leaderboard") }}>
                Hughes Period 4
            </button>
            
        </div>

    )
}

export default Intermediate;
